import Axios from 'axios';
import React, {useState} from 'react';
import './App.css';

function App(props) {
  const [state, setstate] = useState([])

  Axios.get("http://localhost:8080/chat/rooms")
  .then(response=>{
    setstate(response.data)
  })

  return (
    <div className="App">
        <div>{state.map(p=>p.name)}</div>
    </div>
  );
}

export default App;
